/** PANEL **/
#panel {
    position: fixed;
    top: 50px;
    right: -270px;
    z-index: 99999;
    transition: right 0.2s ease-out 0s;
}
#panel:hover {
    right: 0;
}
#panel #content {
    width: 270px;
    height: 470px;
    padding: 10px;
    border-top: 2px solid;
    border-right: none;
    border-bottom: 2px solid;
    border-left: 2px solid;
    z-index: 20;
    border-color: rgba(0, 0, 0, 0.9);
    background-color: rgba(0, 0, 0, 0.9);
    position: relative;
    border-radius: 10px 0 0 10px;
}
#panel #title {
    width: 150px;
    color: red;
    font-weight: bold;
    border-radius: 10px;
    padding: 5px 5px 25px 5px;
    text-align: center;
    position: relative;
    top: 140px;
    left: -80px;
    transform: rotate(-90deg);
    z-index: 1;
}
}
